from typing import List

class Solution:
    def getWordsInLongestSubsequence(self, n: int, words: List[str], groups: List[int]) -> List[str]:
        longest_subsequence = []
        prev_group = -1
        for i in range(n):
            if groups[i] != prev_group:
                longest_subsequence.append(words[i])
                prev_group = groups[i]
        return longest_subsequence
